import React, { createContext } from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));

const Context = createContext(null);

root.render(
  <Context.Provider>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Context.Provider>
);
